// SPDX-License-Identifier: MIT
pragma solidity 0.8.7;
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

contract BibsStaking is Ownable {
  using SafeMath for uint;
    IERC20 dai;
    IERC20 bibscoin;

    address[] stakers;
    mapping(address => uint256) public stakingBalance;
    mapping(address => bool) public hasStaked;

    // Crer un struct comme voting

    constructor(address daiAddress, address bibscoinAddress) {
        // Injecter l'address du token Bibscoin et Dai  utiliser
        dai = IERC20(daiAddress);
        bibscoin = IERC20(bibscoinAddress);
    }

    // stake tokens
    function stakeTokens(uint256 _amount) external {
        require(_amount > 0, "The amount must be positive");
        dai.transferFrom(msg.sender, address(this), _amount);
        stakingBalance[msg.sender] = stakingBalance[msg.sender].add(_amount);
        if (!hasStaked[msg.sender]) {
            stakers.push(msg.sender);
        }
        if (hasStaked[msg.sender] != true) {
            hasStaked[msg.sender] = true;
        }
    }

    // unstake tokens
    function unstakeTokens(uint256 _amount) external {
        require(_amount <= stakingBalance[msg.sender], "You don't own as many tokens");
        bibscoin.transferFrom(address(this), msg.sender, _amount);
        // stakingBalance
    }

    // Issuing tokens
    function issueTokens() external onlyOwner {
        for (uint256 i = 0; i < stakers.length; i++) {
            // A MODIFIER, ENVOI AU STAKERS DU MEME MONTANT DE BIBS QUE DE LEUR MONTANT EN DAI STAK
            if (stakingBalance[stakers[i]] > 0) {
                bibscoin.transfer(stakers[i], stakingBalance[stakers[i]]);
            }
        }
    }
}
